import React, { useState } from 'react';
import './PatientTable.css'; // Import CSS file for styling

const PatientTable = ({ patients }) => {

    function handlePatientClick(patientId) {
        console.log(`Patient with ID ${patientId} clicked`);
        // Implement your logic for handling click event
    }

    return (
        <div>

            <table className="patient-table">
                <thead>
                    <tr>
                        <th>Prenume</th>
                        <th>Nume de familie</th>
                        <th>NumÄƒr de telefon</th>
                    </tr>
                </thead>
                <tbody>
                    {patients.map(patient => (
                        <tr key={patient.id} onClick={() => handlePatientClick(patient.id)}>
                            <td>{patient.firstName}</td>
                            <td>{patient.lastName}</td>
                            <td>{patient.phoneNumber}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default PatientTable;
